import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

const Jumbo = (props) => {
  return (
    <div>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">Welcome to Adulthood 101!</h1>
          <p className="lead">Learn anything or everything that you would like to know as an adult that you might not know or  was not taught to you in school! Such as making an omelette or </p>
        </Container>
      </Jumbotron>
    </div>
  );
};

export default Jumbo;
